   - Simplify the equation: \( y^2 = 0.49y^2 + 49 \)
   - Rearrange to isolate \( y^2 \): \( y^2 - 0.49y^2 = 49 \)
   - Combine like terms: \( 0.51y^2 = 49 \)
   - Solve for \( y^2 \): \( y^2 = \frac{49}{0.51} \approx 96.08 \)
   - Take the square root of both sides: \( y \approx \sqrt{96.08} \approx 9.8 \)

3. **Find \( DE \):**
   - Since \( x = 0.7y \), we substitute \( y \approx 9.8 \) into the equation: \( x = 0.7 \times 9.8 \approx 6.86 \)

