1. **Identify the dimensions of the rectangle:**
   The rectangle is formed by 12 unit squares, which means it is a 3 by 4 rectangle (since \(3 \times 4 = 12\)).

2. **Determine the area of the entire rectangle:**
   The area of the entire rectangle is:
   \[
   3 \times 4 = 12 \text{ square units}
   \]

3. **Identify the shaded regions:**
   The shaded regions are two triangles. One triangle is formed by the top-left 1 by 1 square and the top-right 1 by 1 square, and the other triangle is formed by the bottom-left 1 by 1 square and the bottom-right 1 by 1 square.

4. **Calculate the area of each triangle:**
   Each triangle is a right triangle with legs of length 1 unit. The area of one right triangle is:
   \[
   \frac{1}{2} \times 1 \times 1 = \frac{1}{2} \text{ square units}
   \]
   Since there are two such triangles, the total area of the shaded region is:
   \[
   2 \times \frac{1}{2} = 1 \text{ square unit}
   \]

Therefore, the total area of the shaded region is \(\boxed{1}\).
